  <script>
    var element = document.getElementById('viewer-container');
    var fullscreenIcon = document.getElementById('btn-fullscreen');
    var reelEl;

    function gotoHome() {
      reelEl.reel('frame', 1);
    };

    var pfx = ["webkit", "moz", "ms", "o", ""];
    function RunPrefixMethod(obj, method) {

      var p = 0, m, t;
      while (p < pfx.length && !obj[m]) {
        m = method;
        if (pfx[p] == "") {

        t = typeof obj[m];

          pfx = [pfx[p]];
          return (t == "function" ? obj[m]() : obj[m]);
        }
        p++;
      }

    }

    document.addEventListener("fullscreenchange", function () {
      setFullScreenStyle();
    }, false);

    document.addEventListener("mozfullscreenchange", function () {
      setFullScreenStyle();
    }, false);

    document.addEventListener("webkitfullscreenchange", function () {
      setFullScreenStyle();
    }, false);

    document.addEventListener("msfullscreenchange", function () {
      setFullScreenStyle();
    }, false);

    function setFullScreenStyle() {
      if (RunPrefixMethod(document, "FullScreen") || RunPrefixMethod(document, "IsFullScreen")) {
        fullscreenIcon.className = 'icons exit-fullscreen';
      }
      else {
        fullscreenIcon.className = 'icons fullscreen';
      }
    };

    function toggleFullscreen() {
      if (RunPrefixMethod(document, "FullScreen") || RunPrefixMethod(document, "IsFullScreen")) {
        RunPrefixMethod(document, "CancelFullScreen");
      }
      else {
        RunPrefixMethod(element, "RequestFullScreen");
      }
    };
  </script>
